result:
.chabo{
  width: 100vw;
  height: 100vh;
  background: #122f7e;
}
/* 头部标签 */
.header{
  height: 8%;
  width: 100%;
  margin-bottom: 10px;
  background-image: url('../../../assets/yingzhi/topback.png') ;
  background-repeat: no-repeat;
  background-size: 100%;
}
.daoy{
  position: relative;
  left: 20px;
  top: 5px;
}
.header_text{
  width: 30%;
  text-align: center;
  color: #fff;
  line-height: 50px;
  font-size: 20px;
  letter-spacing: 10px;
  float: left;
  position: absolute;
  left: 50%;
  top: 0%;
  margin-left: -15%;
}
.body{
  width: 95vw;
  height:85vh;
  background: rgba(240,240,240, 0.15);
  margin-left: 2.5vw;
  padding-top: 20px;
}
.body_herder{
  border-radius: 50px;
  height: 30px;
  float: left;
  overflow: hidden;
  width: 250px;
  border: 1px solid #ffffff;
  line-height: 30px;
  color: #fff;
  background: #1e3b88;
  margin-left: 30px;
  margin-bottom: 20px;
}
.body_herder div{
  display: inline-block;
  width: 49.5%;
  text-align: center;
  cursor: pointer;
}
.body_body{
  width: 95%;
  margin-left: 2.5%;
  background: #fff;
  height: 85%;
  overflow: hidden;
}
/* 屏幕 */
.tuc2_left{
  float: left;
  width: 20%;
  border-right: 1px solid #000;
  height: 100%;
}
.left_header{
  padding-left: 10px;
  margin-top: 10px;
  margin-bottom: 10px;
}
.left_body{
  margin-left: 30px;
  font-size: 13px;
  cursor: pointer;
  height: 30px;
  line-height: 30px;
}
.biao{
  width: 10px;
  height: 10px;
  background: red;
  border-radius: 100%;
  float: right;
  position: relative;
  top: 50%;
  right: 12px;
  margin-top: -5px;
}
/* 左边 */
.tuc2_right{
  float: right;
  width: 79%;
  height: 100%;
  overflow: hidden;
}
.tuc2_right table{
  width: 98%;
  border: 1px solid #000;
  margin-top:10px;
}
.tuc2_right table td{
  width: 16%;
  border: 1px solid #000;
  text-align: center;
  height: 30px;
  font-size: 13px;
  cursor: pointer;
}
.trtab{
  background: #17aee2;
}
/* 左边按钮 */
.an{
  width: 100px;
  height: 25px;
  background: #1e3b88;
  margin-right: 20px;
  text-align: center;
  color: #17aee2;
  border-radius: 5px;
  font-size: 12px;
  float: left;
  margin-top: 10px;
  margin-bottom: 10px;
  line-height: 25px;
  cursor: pointer;
}
/* 分页开始 */
.page-bar{
  user-select:none;
  position: absolute;
  bottom: 10%;
  left: 40%;
}
.page-bar li{
  float: left;
  list-style: none
}
.page-bar li:first-child>a {
  margin-left: 0px
}
.page-bar a{
  border: 0;
  text-decoration: none;
  position: relative;
  text-align: center;
  margin-left: -1px;
  cursor: pointer;
  display: inline-block;
  width: 1.6vw;
  height: 1.6vw;
  line-height: 1.6vw;
  border-radius: 100%;
  background: #2373a1;
  margin: 0.5vw;
  color: #ffffff;
  font-size: 0.7vw;
}
.page-bar a .banclick{
  cursor:not-allowed;
}
.page-bar a i{
  font-style:normal;
  color: #d44950;
  margin: 0px 4px;
  font-size: 0.7vw;
}
.active a{
  cursor: default;
  background: #70dcfb;
}
.page-bar .shuang a{
  color: #fff;
}
.fan{
  float: right;
  color: #fff;
  border: 1px solid #fff;
  border-radius: 15px;
  width: 100px;
  text-align: center;
  height: 30px;
  line-height: 30px;
  background: #1e3b88;
  margin-right:30px;
  cursor: pointer;
}
/* 分页结束 */
